function SponsoredBills({ sponsoredBills }) {
    return (
        <div>
            {sponsoredBills && sponsoredBills.map((bill, index) => (
                <div className="card mb-3" key={`bill-${index}`}>
                    <div className="card-body">
                        <h5 className="card-title">{`${bill.type}-${bill.number}`}</h5>
                        <p className="card-text">
                            <strong>Introduced: </strong>{bill.introducedDate}<br />
                            <strong>Bill Title: </strong>{bill.title}<br />
                            <strong>Latest Action: </strong>{`${bill.latestAction.text} (${bill.latestAction.actionDate})`}
                        </p>
                    </div>
                </div>
            ))}
        </div>
    );
}

export default SponsoredBills;
